import { Card, Avatar } from "@mui/material";

type MatchCardProps = any;

export default function MatchCard(props: MatchCardProps) {
  return (
    <Card sx={{
      height: '15vh', 
      border: 'solid',
      borderRadius: '3.5vw',
    }}>
      <Avatar
        alt="Remy Sharp"
        src="/static/images/avatar/1.jpg"
        sx={{ width: 56, height: 56 }}
      />
      <h1>A match</h1>
    </Card>
  )
}
